import React from 'react';
import axios from 'axios'


class userService {


    state = {
        user: [],
    };

    componentDidMount(){
        axios.get("https://localhost:5001/User")
        .then(res => {
            console.log(res);
            this.setState({ user: res.data});
        });
    }

    render(){
        return <ul>{this.state.user.map(user => <li>{user.firstName}</li>)}
            </ul>;

    }
}
